Here's an example of how to perform case-sensitive sorting:

```javascript
const array = ['apple', 'Banana', 'cherry', 'date', 'Elderberry'];

array.sort((a, b) => {
  if (a < b) {
    return -1;
  }
  if (a > b) {
    return 1;
  }
  return 0;
});

console.log(array);
```

In this example, the `sort()` method is called with a comparator function that compares the strings `a` and `b` directly. If `a` is less than `b`, it returns `-1`, if `a` is greater than `b`, it returns `1`, and if they are equal, it returns `0`. This ensures that the sorting is case-sensitive.

The output will be:

```
[ 'Banana', 'Elderberry', 'apple', 'cherry', 'date' ]
