Yes, you can use JavaScript's regular expressions to find the first set of numbers in a string. Here's a simple example of how you can do this:

```javascript
const str = "Here are some numbers: 123 and some more numbers 456.";
const match = str.match(/\d+/);

if (match) {
  console.log("First set of numbers:", match[0]);
} else {
  console.log("No numbers found.");
}
```

In this code:

- `\d+` is the regular expression pattern that matches one or more digits.
- `str.match(/\d+/)` returns an array of matches, or `null` if no match is found.
- `match[0]` contains the first set of numbers found in the string.

This will output:

```
First set of numbers: 123
```

To calculate the hit rate for the onsite attributed data using Spark, you can follow these steps:

1. Load the onsite attributed data and the top frequent queries into JavaRDDs.
2. Broadcast the top frequent queries to all nodes.
3. Filter the onsite attributed data to include only the queries present in the top frequent queries.
4. Use a combination of `mapToPair` and `reduceByKey` to count the cache hits and misses.
5. Calculate the hit rate.

Here's a sample Spark job in Java to achieve this:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.Function2;
import org.apache.spark.api.java.function.PairFunction;
import org.apache.spark.broadcast.Broadcast;
import scala.Tuple2;

import java.util.HashSet;
import java.util.Set;

public class CacheHitRateCalculator {

    public static void main(String[] args) {
        JavaSparkContext sc = new JavaSparkContext("local", "CacheHitRateCalculator");

        // Load onsite attributed data (query, timestamp)
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");

        // Load top frequent queries
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Broadcast top frequent queries
        Set<String> topQueriesSet = new HashSet<>(topQueries.collect());
        Broadcast<Set<String>> broadcastTopQueries = sc.broadcast(topQueriesSet);

        // Filter onsite data to include only top queries
        JavaRDD<String> filteredData = onsiteData.filter(new Function<String, Boolean>() {
            @Override
            public Boolean call(String record) throws Exception {
                String query = record.split(",")[0];
                return broadcastTopQueries.value().contains(query);
            }
        });

        // Map to (query, (hit, miss))
        JavaPairRDD<String, Tuple2<Integer, Integer>> queryHitMiss = filteredData.mapToPair(new PairFunction<String, String, Tuple2<Integer, Integer>>() {
            @Override
            public Tuple2<String, Tuple2<Integer, Integer>> call(String record) throws Exception {
                String query = record.split(",")[0];
                long timestamp = Long.parseLong(record.split(",")[1]);
                // Check if the query is a hit or miss based on the timestamp and cache duration (12 hours)
                if (isCacheHit(query, timestamp)) {
                    return new Tuple2<>(query, new Tuple2<>(1, 0));
                } else {
                    return new Tuple2<>(query, new Tuple2<>(0, 1));
                }
            }
        });

        // Reduce by key to sum hits and misses
        JavaPairRDD<String, Tuple2<Integer, Integer>> reducedQueryHitMiss = queryHitMiss.reduceByKey(new Function2<Tuple2<Integer, Integer>, Tuple2<Integer, Integer>, Tuple2<Integer, Integer>>() {
            @Override
            public Tuple2<Integer, Integer> call(Tuple2<Integer, Integer> a, Tuple2<Integer, Integer> b) throws Exception {
                return new Tuple2<>(a._1 + b._1, a._2 + b._2);
            }
        });

        // Calculate hit rate
        double totalHits = reducedQueryHitMiss.map(_._2._1).reduce((a, b) -> a + b);
        double totalMisses = reducedQueryHitMiss.map(_._2._2).reduce((a, b) -> a + b);
        double hitRate = totalHits / (totalHits + totalMisses);

        System.out.println("Hit Rate: " + hitRate);

